import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Zmieniony import na Routes

import './index.css';
import App from './App';
import LoginPage from './LoginPage';
import RegisterPage from './RegisterPage';

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Routes> {/* Zmienione na Routes */}
        <Route path="/" element={<App />} /> {/* Zmienione na element */}
        <Route path="/login" element={<LoginPage />} /> {/* Zmienione na element */}
        <Route path="/register" element={<RegisterPage />} /> {/* Zmienione na element */}
      </Routes> {/* Zmienione na Routes */}
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);
